import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Sign Up</h1>
      <label>Name:</label>
      <input type="text" id="name" name="Name" pattern="[a-zA-Z]\w{0,16}" placeholder="Enter your  name" required /><br/>
      <label>Email:</label>
      <input type="email" id="email" name="email"
                pattern="[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,}$" placeholder="Enter your  email" /><br/>
      <label>Phone no:</label>
      <input type="tel" id="phone" pattern="\d{10,10}" placeholder="Enter your  phone no"required /><br/>
      <label> Date of Birth:</label>
       <input type="date" id="dob" placeholder="mm-dd-yyyy"
        onfocus="this.max = new Date().toISOString().split('T')['0']" required/><br/>
      <label>Password:</label>
      <input type="password"/><br/>
      <label>Confirm Password:</label>
      <input type="password"/><br/>

    </div>
  );
}

export default App;
